def emailresults(today,exchange,tmplength,successes,numErrors,errors,files=None):
    fromaddr = "x@gmail.com"
    toaddr = "x@gmail.com"
    msg = MIMEMultipart()
    msg['From'] = fromaddr
    msg['To'] = toaddr
    msg['Subject'] = "%s options report for %s exchange" % (today,exchange)

    body = "Options Report for day %s! The total number for the %s is %i\n\
    The number of successful pulls are: %i\n\
    The number of errors are %i\n\
    The details for the errors are as follows: %s" %(today,exchange,tmplength,successes,numErrors,errors)

    msg.attach(MIMEText(body, 'plain'))

    part = MIMEBase('application', "octet-stream")
    part.set_payload(open(files, "rb").read())
    encoders.encode_base64(part)

    part.add_header('Content-Disposition', 'attachment; filename="%s%s.csv"')%(today,exchange)

    msg.attach(part)

    server = smtplib.SMTP('smtp.gmail.com', 587)
    server.starttls()
    server.login(fromaddr, "x")
    text = msg.as_string()
    server.sendmail(fromaddr, toaddr, text)
    server.quit()

def getmultisite(companies,date,headers,exchange,multilist):
    company = companies.lower()
    data = []
    alldata = []
    listindex = multilist.iloc[0]
    a = listindex[listindex.str.match(company).shift(1).fillna(False)]
    multiValue = int(a)
    for i in range(1,multiValue):
        newpage = requests.get('http://www.nasdaq.com/symbol/%s/option-chain?dateindex=-1&page=%i' % (company,i))
        thepage = newpage.text
        soup = BeautifulSoup(thepage, "html.parser")
        try:
            nextbutton = soup.find(id="quotes_content_left_lb_NextPage")
            nextlink = nextbutton.get('href')
        except AttributeError:
            print ('value: %i not found.' %i)
        if nextlink is not None:
            newpage = requests.get(nextlink)
        table = soup.find('div', attrs={'class':'OptionsChain-chart borderAll thin'})
        try:
            rows = table.find_all('tr')
            for row in rows:
                cols = row.find_all('td')
                cols = [ele.text.strip() for ele in cols if not ele.has_attr("colspan")]
                data.append([ele for ele in cols])
            data = [x for x in data if len(x) > 2]
        except AttributeError:
            print ("err0r")
        alldata.append(data)
    return data

def getoptionsdata(startingPoint,companies,date,headers,exchange,multilist):
    print ('starting get options data for ',exchange)
    companyLength = len(companies)
    multilistLength = len(multilist.columns)
    OptionsMegaFile = pd.DataFrame()
    errors = []
    successes = 0
    os.getcwd()
    try:
        os.chdir('./tmp')
    except:
        os.mkdir('./tmp')
        os.chdir('./tmp')
    origsite = ('http://www.nasdaq.com/symbol/%s/option-chain?dateindex=-1')
    currentIteration = 100
    for i in range(startingPoint,companyLength):
        multi = 0
        tickerSymbol = companies[0][i]
        print (tickerSymbol)
        for x in range(0,multilistLength):
            currentCompany = multilist.iloc[0][x]
            try:
                if currentCompany.lower() == tickerSymbol.lower():
                    multi=1
                    data = getmultisite(tickerSymbol,date,headers,exchange,multilist)
                    if len(data)==0:
                        pass
                    else:
                        OptionsMegaFile = OptionsMegaFile.append(data)
                    getoptionsdata(i+1,companies,date,headers,exchange,multilist)
            except:
                pass
        try:
            newsite = (origsite%tickerSymbol)
            page = requests.get(newsite)
            page.encoding = "utf-8-sig"
            print (page.url, 'downloaded successfully')

        except Exception as e:
            print ('exception is: ',e)
            print ('Could not download. '+tickerSymbol+' Will retry in 5 seconds...')
            time.sleep(5)
            continue
        try:
            page.raise_for_status()
            thepage = page.text
            soup = BeautifulSoup(thepage, "html.parser")
            data = []
            table = soup.find('div', attrs={'class':'OptionsChain-chart borderAll thin'})
            rows = table.find_all('tr')
            for row in rows:
                cols = row.find_all('td')
                cols = [ele.text.strip() for ele in cols if not ele.has_attr("colspan")]
                data.append([ele for ele in cols])
            data = [x for x in data if len(x) > 2]
            successes+=1
            if multi != 1:
                if len(data)==0:
                    pass
                else:
                    OptionsMegaFile = OptionsMegaFile.append(data)
        except AttributeError:
            companiesNotFound = "Not Found %s" % tickerSymbol, page.url
            print (companiesNotFound)
            errors.append(companiesNotFound)
        if i>=currentIteration:
            iterationFileName = 'OptionsMega%s%i %s.csv'%(exchange,i,today)
            OptionsMegaFile.to_csv(iterationFileName,sep=",",encoding="utf8",header=None,index=False)
            currentIteration+=100
    numErrors = len(errors)
    cwd = os.getcwd()
    megaPath = ('%s/%s %sMega.csv')%(cwd,today,exchange)
    OptionsMegaFile.to_csv(megaPath,sep=",",encoding="utf8",header=None,index=False)
    emailresults(today,exchange,companyLength,successes,numErrors,errors,megaPath)
    return OptionsMegaFile
